import React from 'react';
import styled from 'styled-components';
import PropTypes from 'prop-types';

const Department_List = () => {
	const HR = styled.hr`border: 0.125rem solid white;`;
	const Label = styled.label`padding-top: 2rem;`;
	return (
		<div className="container">
			<div className="row">
				<div className="col-sm-4  dptform">
					<div class="cards">
						<div class="form-group">
							<Label for="comment">Department Form</Label>
							<HR />
							<h6>Name</h6>
							<textarea class="form-control" rows="2" id="comment" />
						</div>
						<button type="button" class="btn btn-primary">
							Save
						</button>
						<button type="button" class="btn btn-danger">
							Delete
						</button>
					</div>
				</div>
			</div>
		</div>
	);
};

Department_List.propTypes = {};

export default Department_List;
